import React, { Component } from 'react';
import { Form, Button } from 'semantic-ui-react';
import container from '../../ethereum/container';
import web3 from '../../ethereum/web3';

class Formcreate extends Component {

    state = {
        ContainerID:'',
        WarehouseID:'',
        ProductName:'',
        HalalSatus:'',
        Quantity:''

    }


    onSubmit = async (event) => {
        event.preventDefault();

        const accounts = await web3.eth.getAccounts();

        await container.methods.SetUserInfo(this.state.ContainerID, this.state.WarehouseID, this.state.ProductName,this.state.HalalSatus, this.state.Quantity).send({from: accounts [0]});

    };

    render() {
        return (

            <html>
              <head>
                <meta charset="utf-8" name="viewport" content="width=device-width, initial-scale=1"/>
                <link rel="stylesheet" href="/style.css"/>
                <link rel="stylesheet" href="//cdnjs.cloudflare.com/ajax/libs/semantic-ui/2.2.12/semantic.min.css"/>
                <link rel="stylesheet" href="https://maxcdn.bootstrapcdn.com/bootstrap/4.0.0-alpha.2/css/bootstrap.min.css"/>
                <script src="https://maps.googleapis.com/maps/api/js?key=AIzaSyAq06l5RUVfib62IYRQacLc-KAy0XIWAVs"></script>
                
              </head>

              <body>

<script>
*
  margin: 0;
  padding: 0;
  box-sizing: border-box;
  font-family: "Poppins", sans-serif;

body
  margin: 0;
  padding: 0;
  background: linear-gradient(120deg,#2980b9, #8e44ad);
  /*background-image: url('logistics_bg.jpg');
  background-size: cover;
  background-repeat: no-repeat;*/
  height: 100vh;
  overflow: hidden;
}
</script>

                <div class="container"></div>
                  <div class="center">
                  <h1>Container Form</h1>
                  <Form onSubmit={this.onSubmit}>
                  <form method="post">
                    <div class="txt_field">
                    <input 
                            value={this.state.ContainerID}
                            onChange={event =>
                                this.setState({ContainerID: event.target.value})}
                        />
                      <span></span>
                      <label>Container ID</label>
                    </div>
                    <div class="txt_field">
                    <input 
                            value={this.state.WarehouseID}
                            onChange={event =>
                                this.setState({WarehouseID: event.target.value})}
                        />
                      <span></span>
                      <label>Warehouse ID</label>
                    </div>
                    <div class="txt_field">
                    <input 
                            value={this.state.ProductName}
                            onChange={event =>
                                this.setState({ProductName: event.target.value})}
                        />
                      <span></span>
                      <label>Product Name</label>
                    </div>
                    <div class="txt_field">
                    <input
                            label="Halal/Haram"
                            labelPosition="right" 
                            value={this.state.HalalSatus}
                            onChange={event =>
                                this.setState({HalalSatus: event.target.value})}
                        />
                      <span></span>
                      <label>Halal Status</label>
                    </div>
                    <div class="txt_field">
                    <input 
                            value={this.state.Quantity}
                            onChange={event =>
                                this.setState({Quantity: event.target.value})}
                        />
                      <span></span>
                      <label>Quantity</label>
                    </div>
            
                    <Button primary>Submit</Button>
                  </form>
                  </Form>
                </div>
              </body>
            </html>
            
        );
    }
}

export default Formcreate;
